play.comments:
Lawrence died first, after setting the ship to self destruct and telling the pilot to set course for Mars, where we would crash and die. He was hoping for Rich to die.

@Matt died next, the wheelchair-bound scientist who also lost the use of his hands during the action. He was just hoping that Loz didn't make it.

@Naomi was acting strangely and doing dodgy things with the engines, she eventually got ganked while trying to save herself in an escape pod.

@Richard fell next, suffering wound after wound in his attempts to flee. He disabled the ship's controls strangely after being ordered to crash the ship on Mars. However, he was hoping Naomi would die.

Becky the mechanic was on the brink of survival. She had fixed up the engines to ensure the crew would get home safe (even though it was heading to Mars). She survived near-constant alien attacks, but couldn't get out in an escape pod before @Lawrence's self destruct sequence finished. Becky would have won if she alone had survived, or the ship made it to Earth.

Loz setting us on a death spiral, before immediately walking into a room with the alien queen and being insta-killed was fucking amazing #bgstats
